import React from 'react';
import Part from './Part';

const Content = (props) => {
    return (
        <>
        <Part part={props.course.parts[0].name} exercises={props.course[0].parts.exercises} />
        <Part part={props.course.parts[1].name} exercises={props.course[1].parts.exercises} />
        <Part part={props.course.parts[2].name} exercises={props.course[2].parts.exercises} />
        </>
    )
};

export default Content
